import { gql } from "@apollo/client";

const SET_PROYECTO = gql `  
    mutation setProyecto( $nombre:String!,$objetivosGenerales:String!,$objetivosEspecificos:String!,$presupuesto:Int!,$docLider:Int!,$nombreLider:String! ){
        AgregarProyecto(proyecto :{
            nombre:$nombre,
            objetivosGenerales: $objetivosGenerales,            
            objetivosEspecificos:${objetivosEspecificos}, 
            presupuesto:$presupuesto,
            docLider:$docLider,
            nombreLider:$nombreLider

       }){        
            nombre
            objetivosGenerales            
            objetivosEspecificos
            presupuesto
            docLider
            nombreLider
       }
    }
` ;
export default SET_PROYECTO;
